Had an amazing time with @mauimatchaa + @matchamcentea’s event in Maui at the @thewestinmaui’s @heavenlyspamaui. Check them out for the best matcha drinks & newly launched skincare✨available online! #MauiMatcha #MatchaMcentea

Owners: @shelllmichellle - @mauimatchaa 
@amcentee04 - @matchamcentea

One of the best 4th of Julys in my life ~Thanks to @fsvail🤍🇺🇸 #fourseasonsvail #fourseasons #godblessamerica 

@fsvail offered endless adventures from the cotton candy station, 4th-of-July poolside BBQ, to spectacular meals at the Remedy Bar with breathtaking mountain views.. and so much more😅. I’ll be posting a more of what I got to do during my stay at the @fsvail🏔 #staytuned 

& thanks for tagging along with me so last minute @madswithcurls 🫶🏼

@fsvail the most enchanting fall destination🍂✨ 

The Four Seasons Vail - Spa offers a variety of facials of healthy natural glow treatments designed to brighten and hydrate while you relax in mountain spa bliss- a favorite is the S’mores Indulgence Facial✨ 

And if facial’s aren’t for you, they offer luxury massages that allow you to relax and recover with a wide variation of healing massages, such as the High Altitude Adjustment💆🏽‍♀️ Along with numerous other services. #Vail #FourSeasons #Spa
